INSERT INTO `ninety_question` VALUES ('306', 'Hot Industry Identification', 'raw', 'a:5:{s:8:\"question\";s:81:\"Is this investment in an industry that is considered  a strong industry prospect?\";s:5:\"lower\";s:169:\"Starting a new venture in the later stages of the market life cycle suggests that the market will be saturated and you may struggle to obtain a satisfactory market share\";s:6:\"higher\";s:195:\"Commercialising a new disruptive innovation suggests that in a fragmented market a new startup will have the opportunity to command dominance in the market using an accelerated growth strategy.  \";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:7:\"Not Hot\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:12:\"Somewhat Hot\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:4:\"Warm\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:9:\"Quite Hot\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:8:\"Very Hot\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}', '2017-09-10 13:07:09', null, 'true', '165', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('305', 'Foreign Exchange', 'raw', 'a:5:{s:8:\"question\";s:61:\"Are the business activities subject to foreign exchange risk?\";s:5:\"lower\";s:137:\"The market value of your business is impacted by unexpected currency rate volatility as your profit margin is too low to accommodate this\";s:6:\"higher\";s:163:\"Robust profit margins indicate that exposure to unexpected currency rate fluctuations will not affect the company’s market position compared to competitors. \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:22:\"High Level of Exposure\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:24:\"Medium Level of Exposure\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:16:\"Somewhat Exposed\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:21:\"Low Level of Exposure\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:11:\"No Exposure\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '165', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('304', 'Quota/Tariff Protection', 'raw', 'a:5:{s:8:\"question\";s:60:\"Is there quota/tariff protection for the company\'s products?\";s:5:\"lower\";s:143:\"High reliance on quota protection leaves the business vulnerable to potential threats from imports should the quota protection structure change\";s:6:\"higher\";s:183:\"Strong quota protection mechanisms for a start-up protect against foreign competition offering their products at a price lower than production cost as a strategy to enter the market. \";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:13:\"No Protection\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:18:\"Minimal Protection\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:18:\"Somewhat Protected\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:24:\"Above Average Protection\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:14:\"100% Protected\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '164', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('303', 'Specifications', 'raw', 'a:5:{s:8:\"question\";s:91:\"Does the product currently comply with all the required regulations for the defined market?\";s:5:\"lower\";s:179:\"Not meeting required industry or market regulations means that critical success factors and performance criteria may not have been addressed during the product development phase. \";s:6:\"higher\";s:240:\"Full compliance with industry or market regulations suggests that critical success factors and performance criteria have been met during the development phase and that the product/service is tailored to meet diverse market requirements.\r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:15:\"Does Not Comply\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:18:\"Minimal Compliance\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:18:\"Somewhat Compliant\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:24:\"Above Average Compliance\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:15:\"100% Compliance\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}', '2017-09-10 13:07:09', null, 'true', '164', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('302', 'Specific Regulations', 'raw', 'a:5:{s:8:\"question\";s:64:\"Are there specific regulations regarding the use of the product?\";s:5:\"lower\";s:134:\"Highly regulated industries can curtail the ability to innovate and adapt the business model to accommodate fluctuations in the market\";s:6:\"higher\";s:124:\"A business not bound by heavy regulation is better able to adapt to meet shifting trends and fluctuating market demand. \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:16:\"Highly Regulated\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:18:\"Somewhat Regulated\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:19:\"Average Regulations\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:19:\"Minimal Regulations\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:13:\"Not Regulated\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '164', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('301', 'Environmental Legislation', 'raw', 'a:5:{s:8:\"question\";s:89:\"Is the business subject to either broad or specific government Environmental Legislation?\";s:5:\"lower\";s:119:\"Changes to government environmental legislation may negatively impact profit margins and thus stability of the business\";s:6:\"higher\";s:178:\"No sensitivity to government environmental legislation provides greater agility in utilizing appropriate frameworks that will not impact the profitability of the business.   \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:7:\"Average\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:5;}}s:6:\"global\";i:1;}', '2017-09-10 13:07:09', null, 'true', '164', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('300', 'Government Legislation', 'raw', 'a:5:{s:8:\"question\";s:83:\"Is the business subject to either broad or specific government trading legislation?\";s:5:\"lower\";s:225:\"A high level of sensitivity to government trading legislation means that the business must regular monitor such legislation to act proactively and reduce any significant impact that may decrease sustainability of the business\";s:6:\"higher\";s:182:\"Minimal or no sensitivity to government trading legislation suggests there are no hindrances in meeting or adapting to policy and regulatory changes that may occur from time to time.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:7:\"Average\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}', '2017-09-10 13:07:09', null, 'true', '164', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('299', 'Political Sensitivity', 'raw', 'a:5:{s:8:\"question\";s:41:\"Is this investment Politically Sensitive?\";s:5:\"lower\";s:167:\"Sensitivity to political changes in relation to government, regulatory or policy changes leads to inefficient capital allocation, in turn reducing company performance.\";s:6:\"higher\";s:180:\"No affiliation or synergy with the political environment suggests the viability of your business will not be affected when changes in government or regulatory amendments occur.\r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:7:\"Average\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}', '2017-09-10 13:07:09', null, 'true', '164', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('298', 'Reducing financial needs', 'raw', 'a:5:{s:8:\"question\";s:61:\"Can you reduce your expenses without Compromising on quality?\";s:5:\"lower\";s:180:\"Cost cutting is the simplest way to improve the profitability of your startup.  If you are not able to streamline your expenses this will have a direct impact on your profit margin\";s:6:\"higher\";s:136:\"Introducing systematic cost-control methods results in immediate savings and ensures more competitive profit margins in the longer term.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:8:\"Possibly\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:9:\"Partially\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:11:\"Potentially\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}', '2017-09-10 13:07:09', null, 'true', '162', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('297', 'Future Financial Needs', 'raw', 'a:5:{s:8:\"question\";s:53:\"Have future funding needs been identified for growth?\";s:5:\"lower\";s:172:\"Equity funding infers you are placing a priority on growth. Neglecting to project future funding requirements suggests that resourcing a growth strategy will be difficult. \";s:6:\"higher\";s:146:\"The right financing strategy can deliver stability, security and long term profits which are key elements that underpin a reliable growth strategy\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:9:\"Partially\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}', '2017-09-10 13:07:09', null, 'true', '162', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('296', 'Current Financial Needs', 'raw', 'a:5:{s:8:\"question\";s:61:\"Has the company identified both debt and equity requirements?\";s:5:\"lower\";s:195:\"It is important to strike the right balance between debt and equity as a high debt to equity ratio infers that the business will be unable to generate enough cash to satisfy its debt obligations.\";s:6:\"higher\";s:207:\"Well-balanced funding requirements are beneficial to the business as lenders and investors prefer a lower debt to equity ratio because their interests are better protected in the event of a business decline.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:9:\"Partially\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}', '2017-09-10 13:07:09', null, 'true', '162', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('295', 'Plan Developed by Team', 'raw', 'a:5:{s:8:\"question\";s:44:\"Was the business plan developed by the team?\";s:5:\"lower\";s:234:\"A plan developed by external consultants rather than the team may provide a blueprint to guide the business, but it will not adequately engage the team members nor provide the depth of insight required to run the business successfully\";s:6:\"higher\";s:286:\"Team members who research and compile their own business plan gain important in-depth insights into all internal and external components of the business. This knowledge and ability to pivot and adapt the goals, objectives and strategies with simplicity make the plan a living document. \";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:12:\"A Consultant\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:18:\"Minimal Assistance\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:20:\"Team with Assistance\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:26:\"With External Stakeholders\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:14:\"The Team Alone\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}', '2017-09-10 13:07:09', null, 'true', '161', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('294', 'Strategy Congruence', 'raw', 'a:5:{s:8:\"question\";s:61:\"Do the financials correlate to the rest of the business plan?\";s:5:\"lower\";s:276:\"The financial section of a business plan is one of the most essential components of the plan and is critical for successfully steering your business forward. Without a realistic and credible financial plan you will find it difficult to obtain investor funding or a bank loan. \";s:6:\"higher\";s:297:\"The financial section of your business plan is only valuable when it is realistic, credible and fully correlates to the remainder of the plan.  A defensible financial plan is essential for successfully steering your business forward, and is crucial if you seek investor funding or a bank loan.\r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:11:\"Selectively\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:18:\"Strong Correlation\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}', '2017-09-10 13:07:09', null, 'true', '161', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('293', 'Marketing Strategy Addressed', 'raw', 'a:5:{s:8:\"question\";s:96:\"Are the 4 P\'s of marketing; Price, Place Product and Promotion addressed adequately in the plan?\";s:5:\"lower\";s:196:\"Marketing tells people about your product, service, and company and is responsible for generating demand and sales leads. A poorly addressed marketing strategy will severely limit growth in sales.\";s:6:\"higher\";s:245:\"A thorough marketing strategy will use customer feedback to refine and prioritize product features, gain insight into the correct pricing model, and facilitate long-term customer relationships, as well as meet investor’s marketing requirements\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Vaguely\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:10:\"Summarised\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:14:\"Detailed Fully\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '161', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('292', 'Business Plan', 'raw', 'a:5:{s:8:\"question\";s:33:\"Is there a current business plan?\";s:5:\"lower\";s:181:\"Little to no business planning provides poor clarity on start-up direction or future vision and goals to reach for. Poor planning can be detrimental to the viability of the business\";s:6:\"higher\";s:288:\"Efforts put into business planning generate an in-depth knowledge of the business and its environment, and enables the factoring of future growth and direction and to plan for changes in the market, growing or slowing trends, and new innovations or directions to take as the company grows\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:13:\"Exec. Summary\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:10:\"Incomplete\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:7:\"Partial\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '161', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('291', 'External Contractors', 'raw', 'a:5:{s:8:\"question\";s:55:\"Does the business rely heavily on external contractors?\";s:5:\"lower\";s:135:\"Heavy reliance on external contractors indicates vulnerability should the contractor not meet their obligations or their business fails\";s:6:\"higher\";s:257:\"Non-reliance on external contractors suggests you utilise these resources in a savvy way to bring in specialist knowledge/skills on an as needs basis. This approach reduces the risk element of relying on too many third parties in day to day operations. \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:14:\"As Need Arises\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:18:\"On a Regular Basis\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}', '2017-09-10 13:07:09', null, 'true', '160', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('290', 'Future Support', 'raw', 'a:5:{s:8:\"question\";s:101:\"Does the Company propose to utilise external consultants to support its activities where appropriate?\";s:5:\"lower\";s:145:\"External professional consultants add value to your business by giving you the freedom to outsource essential skills and knowledge on your terms \";s:6:\"higher\";s:195:\"Through using external professional consultants you bring greater insight and knowledge into the business, and expand access into new networks, plus reduce staffing costs improving cash flow \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:14:\"As Need Arises\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:10:\"Frequently\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:16:\"On Regular Basis\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}', '2017-09-10 13:07:09', null, 'true', '160', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('289', 'External Management Support', 'raw', 'a:5:{s:8:\"question\";s:79:\"Has the company identified external professional consultants where appropriate?\";s:5:\"lower\";s:233:\"No intent to engage with professional external consultants demonstrates a lack of understanding of the importance to forge complementary relationships where the entrepreneurial team does not have the requisite skills or capabilities.\";s:6:\"higher\";s:247:\"Early identification of appropriate professional external consultants demonstrates insight and understanding of the importance of forging complementary relationships where the entrepreneurial team does not have the requisite skills or capabilities\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}', '2017-09-10 13:07:09', null, 'true', '160', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('288', 'Minimum Viable product Financing', 'raw', 'a:5:{s:8:\"question\";s:78:\"Has the business the capacity to produce a minimal viable product for testing?\";s:5:\"lower\";s:232:\"A Minimum Viable Product (MVP) is an early iteration not a completely finished version of the product and is essential for early testing of the product/service in order to determine market need and allow for adaptation as required. \";s:6:\"higher\";s:145:\"Building a minimum viable product (MVP) for testing gives you early access to customer feedback to ensure your final product meets market demand.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:8:\"Possibly\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:9:\"Partially\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:11:\"Potentially\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}', '2017-09-10 13:07:09', null, 'true', '159', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('287', 'Ability to bootstrap the business', 'raw', 'a:5:{s:8:\"question\";s:50:\"Is it too early to seek professional equity funds?\";s:5:\"lower\";s:154:\"Inability to demonstrate ability to bootstrap in the early phases of the venture suggests the venture may experience difficulty in sourcing equity funding\";s:6:\"higher\";s:230:\"Bootstrapping conducted to grow the business increases the value of the company, proves the business model and competence of the team, and demonstrates the business is ready to source and manage equity funding for growth purposes.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '159', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('286', 'Historical Record', 'raw', 'a:5:{s:8:\"question\";s:43:\"Has the business a record of bootstrapping?\";s:5:\"lower\";s:151:\"Bootstrapping can create a level of financial risk if it does not provide enough investment for the company to become successful at a reasonable rate. \";s:6:\"higher\";s:259:\"Prudent bootstrapping enables the entrepreneurial team to maintain early control over all decisions. It also has capacity to enables greater value to be built into the business prior to seeking outside investment which can mean postponing dilution of equity. \";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}', '2017-09-10 13:07:09', null, 'true', '159', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('285', 'Personnel Integrity', 'raw', 'a:5:{s:8:\"question\";s:53:\"Does the Team indicate a strong level of integrity?\r\n\";s:5:\"lower\";s:216:\"Poor levels of integrity within a team destroy the ability to perform satisfactorily which diminishes coherence of the team, the perceptions of internal and external stakeholders, and thus performance of the business\";s:6:\"higher\";s:254:\"Team integrity is a vital ingredient in ability to perform satisfactorily. Much like the foundation of a building, integrity is essential for lasting success and provides a work environment with three key qualities: stability, well-being, and repute.\r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '157', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('284', 'Team Structure', 'raw', 'a:5:{s:8:\"question\";s:56:\"Does the Team indicate a strong cohesiveness capability?\";s:5:\"lower\";s:237:\"Cohesiveness is the extent to which team members stick together and remain united in the pursuit of a common goal. A lack of this capability reduces the team’s ability to make sound business decisions that benefit business performance.\";s:6:\"higher\";s:225:\"Members of a highly cohesive team work to a purpose. With a focus on the job to be done, they respect everyone on the team, and fully commit to team decisions and strategies, creating accountability in each member of the team\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:13:\"Not Evident\r\n\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:13:\"Some Evidence\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:19:\"Selected Evidence\r\n\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:19:\"Apparent Evidence\r\n\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:17:\"Strong Evidence\r\n\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}', '2017-09-10 13:07:09', null, 'true', '157', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('283', 'Psychological Balance', 'raw', 'a:5:{s:8:\"question\";s:62:\"Do the key personnel indicate a strong psychological balance? \";s:5:\"lower\";s:141:\"A poor psychological balance amongst key personnel can hinder the efficiency of the team and negatively affect team cohesiveness and balance.\";s:6:\"higher\";s:171:\"A resilient psychological balance ensures the team can control multiple responsibilities to prioritize and balance workload effectively to achieve goals and meet deadlines\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:13:\"Not Evident\r\n\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:16:\"Minimal Evidence\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:13:\"Some Evidence\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Often Evident\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:15:\"Clearly Evident\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}', '2017-09-10 13:07:09', null, 'true', '157', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('282', 'Communication Skills', 'raw', 'a:5:{s:8:\"question\";s:47:\"Does the team have strong communication skills?\";s:5:\"lower\";s:67:\"Poor communication skills impacts at all levels across the business\";s:6:\"higher\";s:235:\"Every element of the business is affected by good communication. These skills incite others to work towards specified goals and generate stronger engagement with all internal and external stakeholders associated with the business. \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:14:\"Definitely Not\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}', '2017-09-10 13:07:09', null, 'true', '156', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('281', 'Entrepreneurial Team', 'raw', 'a:5:{s:8:\"question\";s:56:\"Does the team appear to have strong leadership skills?\r\n\";s:5:\"lower\";s:172:\"If strong leadership skills are missing, the team will lack cohesion, balance and the ability to act in a united manner for day to day operations and any new opportunities \";s:6:\"higher\";s:145:\"All team members must lead and manage their own areas of expertise, but will still enjoy a strong team cohesion and direction of the team leader \";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:14:\"Definitely Not\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:12:\"Broad Skills\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:22:\"Some Specific Skills\r\n\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:20:\"Above Average Skills\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:23:\"Extremely Strong Skills\";s:5:\"score\";i:5;}}s:6:\"global\";i:1;}', '2017-09-10 13:07:09', null, 'true', '156', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('280', 'Lead Entrepreneur', 'raw', 'a:5:{s:8:\"question\";s:61:\"Is there a lead entrepreneur with strong leadership skills?\r\n\";s:5:\"lower\";s:94:\"Lack of a lead entrepreneur diminishes the ability to drive the team towards the unified goal \";s:6:\"higher\";s:162:\"A strong leader creates an environment that meets the continual challenges as market conditions change and the business must pivot to react to new opportunities  \";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:16:\"Definitely Not\r\n\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:17:\"Some Broad Skills\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:22:\"Some Specific Skills\r\n\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:22:\"Above Average Skills\r\n\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:25:\"Extremely Strong Skills\r\n\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}', '2017-09-10 13:07:09', null, 'true', '156', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('279', 'Functional Knowledge and Skill Balance', 'raw', 'a:5:{s:8:\"question\";s:81:\"Does the team have the knowledge and skills to develop the business at this time?\";s:5:\"lower\";s:152:\"Lack of appropriate functional knowledge and skills slows down the Commercialisation process and the ability to attract talent, resources and investment\";s:6:\"higher\";s:154:\"Appropriate functional knowledge and a balance of skills will accelerate the ability to enter the market and attract talent, resources and investment.\r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:30:\"Lacking Knowledge and Skills\r\n\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:28:\"Minimal Knowledge and Skills\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:27:\"Some Knowledge and Skills\r\n\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:34:\"Above Average Knowledge and Skills\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:30:\"Excellent Knowledge and Skills\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}', '2017-09-10 13:07:09', null, 'true', '155', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('278', 'Technical Experience', 'raw', 'a:5:{s:8:\"question\";s:70:\"Do team members have technical experience appropriate to the business?\";s:5:\"lower\";s:149:\"Lack of technical experience suggests this requirement will require reliance on a third party which will impact cash flow and/or equity shareholding \";s:6:\"higher\";s:137:\"Appropriate technical experience allows in-house ownership and management of critical processes and regular innovation of product/service\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:14:\"No Experience \";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:18:\"Little Experience \";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:16:\"Some Experience \";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:11:\"Experienced\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:20:\"Extensive Experience\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}', '2017-09-10 13:07:09', null, 'true', '155', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('277', 'Financial Experience', 'raw', 'a:5:{s:8:\"question\";s:42:\"Do team members have financial experience?\";s:5:\"lower\";s:177:\"It is crucial that at least one team member brings financial acumen and experience to the business in order to better manage cash flow, profit margins and forecasting/budgeting.\";s:6:\"higher\";s:147:\"Solid financial experience builds a stronger business foundation that will be reactive to fluctuations that may impact negatively upon the business\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:14:\"No Experience \";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:18:\"Little Experience \";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:29:\"Well Qualified/No Experience \";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:30:\"No Qualifications/ Experienced\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:25:\"Qualified and Experienced\";s:5:\"score\";i:5;}}s:6:\"global\";i:1;}', '2017-09-10 13:07:09', null, 'true', '155', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('276', 'Distribution Experience', 'raw', 'a:5:{s:8:\"question\";s:60:\"Do team members have distribution knowledge in the business?\";s:5:\"lower\";s:187:\"Little or no knowledge regarding access to distribution channels will inhibit getting product to market/customers and may the leave business with higher than necessary distribution costs \";s:6:\"higher\";s:163:\"Qualified and experienced in accessing innovative distribution channels provides a wider exposure to the market and greater potential for accelerated growth   \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:14:\"No Experience \";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:18:\"Little Experience \";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:29:\"Well Qualified/No Experience \";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:34:\"No Qualifications/Much Experience \";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:26:\"Qualified and Experienced \";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '155', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('275', 'Sales/Marketing Experience', 'raw', 'a:5:{s:8:\"question\";s:64:\"Do team members have sales/marketing experience in the business?\";s:5:\"lower\";s:133:\"Lack of sales and marketing experience will affect revenue streams and the potential for steady growth and new business opportunities\";s:6:\"higher\";s:125:\"Insights into sales and marketing techniques enables proactive exposure of your business to a wider potential customer base. \";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:13:\"No Experience\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:17:\"Little Experience\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:29:\"Well Qualified/ No Experience\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:30:\"No Qualifications/ Experienced\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:25:\"Qualified and Experienced\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '155', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('274', 'Industry and Technical Experience', 'raw', 'a:5:{s:8:\"question\";s:71:\"Does the team contain members who have appropriate industry experience?\";s:5:\"lower\";s:293:\"Lack of industry experience curtails the ability of the business to read the gaps in the market that identify potential opportunities. Industry experience is not something that can be acquired in the short term, hence significant time and effort needs to be invested to garner this knowledge. \";s:6:\"higher\";s:181:\"Team members with substantial industry experience have the deep insights required to devise solutions for problems or innovate proactively with regard to potential opportunities\r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:13:\"No Experience\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:16:\"Minor Experience\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:20:\"Selective Experience\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:16:\"Sound Experience\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:20:\"Extensive Experience\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '155', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('273', 'Knowledge of Business', 'raw', 'a:5:{s:8:\"question\";s:97:\"Do team members have knowledge of this business and the industry and market in which it operates?\";s:5:\"lower\";s:138:\"Minimal knowledge of the market/industry will impact heavily on the ability of the business to reach customers efficiently and effectively\";s:6:\"higher\";s:168:\"Knowledge of the critical success factors for an industry enables a business to better understand and react to market trends and better service their customer segments \";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:12:\"No Knowledge\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:17:\"Minimal Knowledge\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:14:\"Some Knowledge\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:15:\"Sound Knowledge\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:19:\"Extensive Knowledge\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}', '2017-09-10 13:07:09', null, 'true', '155', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('272', 'Marketing Instinct and Ability', 'raw', 'a:5:{s:8:\"question\";s:56:\"How strong is the team\'s marketing instinct and ability?\";s:5:\"lower\";s:183:\"Poor marketing skills and abilities can reduce your ability to actively promote and market what could be a great business thus alienating the business from potential customer segments\";s:6:\"higher\";s:177:\"The ability to deliver Insight-powered marketing and performance can provide insights into consumer experiences that can i9nduce customer loyalty and produce avenues for growth.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:13:\"No Experience\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:16:\"Minor Experience\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:19:\"Selected Experience\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:16:\"Sound Experience\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:20:\"Extensive Experience\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}', '2017-09-10 13:07:09', null, 'true', '154', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('271', 'Entrepreneurial History', 'raw', 'a:5:{s:8:\"question\";s:52:\"How strong is the team\'s entrepreneurial experience?\";s:5:\"lower\";s:127:\"Poor entrepreneurship skills and lack of business experience will affect the likelihood of the entrepreneurial team’s success\";s:6:\"higher\";s:105:\"Extensive business and entrepreneurial skills aid in the formation, survival and growth of a new business\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:13:\"No Experience\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:16:\"Minor Experience\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:19:\"Selected Experience\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:16:\"Sound Experience\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:20:\"Extensive Experience\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '154', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('270', 'Startup and/or Harvest Experience', 'raw', 'a:5:{s:8:\"question\";s:103:\"Have team members been involved in starting, growing, and/or harvesting other entrepreneurial ventures?\";s:5:\"lower\";s:182:\"Lack of experience in growing and or harvesting ventures may be an indicator that they are not focused on the eventual transition of the venture and or not able to cope with scaling.\";s:6:\"higher\";s:153:\"Prior start-up experience provides greater competence and capability in managing and transitioning the business from start-up through to eventual harvest\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:13:\"No Experience\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:19:\"Little Experience\r\n\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:15:\"Some Experience\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:16:\"Sound Experience\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:20:\"Extensive Experience\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '154', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('269', 'Hurt Capital', 'raw', 'a:5:{s:8:\"question\";s:110:\"Has the entrepreneur invested sufficient funds in the business to indicate a solid confidence in the business?\";s:5:\"lower\";s:133:\"Not having enough skin in the game can be seen by investors as a lack of confidence in the product/ service the business has to offer\";s:6:\"higher\";s:520:\"Adequate entrepreneur funding indicates a strong knowledge of the business and the industry, providing investors with a sense of confidence in the entrepreneur and that the entrepreneur has enough invested in the business to ensure financial success is Adequate entrepreneur funding indicates a strong knowledge of the business and the industry, providing investors with a sense of confidence in the entrepreneur and that the entrepreneur has enough invested in the business to ensure financial success is achieved\r\n\r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:13:\"None Invested\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:9:\"Time Only\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:27:\"Significant Time, Some Cash\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:25:\"Significant Time and Cash\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:10:\"Everything\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}', '2017-09-10 13:07:09', null, 'true', '153', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('268', 'Equity', 'raw', 'a:5:{s:8:\"question\";s:62:\"Does the entrepreneur accept their equity is being diminished?\";s:5:\"lower\";s:181:\"Unless the equity in the business is producing dividends each year, it has little value, therefore it is important to accept equity is being diminished for the good of the business.\";s:6:\"higher\";s:181:\"Relinquishing equity can progress growth of your business into new markets. Giving up or selling equity is crucial to attracting the right talent and resources into the business\r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:33:\"Not Prepared to Accept Diminution\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:30:\"Not Addressed in Business Plan\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:38:\"Superficial Reference in Business Plan\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:36:\"Somewhat Referenced in Business Plan\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:15:\"Full Acceptance\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '153', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('267', 'Control', 'raw', 'a:5:{s:8:\"question\";s:79:\"Has the entrepreneur acknowledged acceptance in shared control of the business?\";s:5:\"lower\";s:258:\"Lack of acknowledgement of shared control can create tension between the entrepreneurial team and investment parties which inhibit operations and growth of the company through inability to establish priorities among the opportunities and problems they face. \";s:6:\"higher\";s:161:\"Entrepreneurs who give up more equity and share control will attract further investment capital which will result in building greater value into the company \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:30:\"Not Addressed in Business Plan\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:19:\"No Ready Acceptance\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:17:\"Partial Reference\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:19:\"Somewhat Referenced\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:21:\"Accepts Control Shift\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}', '2017-09-10 13:07:09', null, 'true', '153', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('266', 'Exit Target', 'raw', 'a:5:{s:8:\"question\";s:38:\"Has a specific target been identified?\";s:5:\"lower\";s:153:\"Difficulty in identifying a specific target suggests your business may not be attractive to potential buyers due to lack of strategic and growth planning\";s:6:\"higher\";s:166:\"A clear and defined exit strategy demonstrates the business has strategic goals that will promote long term growth and profitability to achieve the planned exit. \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:4:\"None\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:21:\"Existing Shareholders\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:17:\"Private Placement\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:19:\"Targeted Trade Sale\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:23:\"Initial Public Offering\";s:5:\"score\";i:5;}}s:6:\"global\";i:1;}', '2017-09-10 13:07:09', null, 'true', '151', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('265', 'Exit Strategy', 'raw', 'a:5:{s:8:\"question\";s:70:\" Is there a planned means of exiting the business that is appropriate?\";s:5:\"lower\";s:131:\"No defined exit strategy or your strategy is unrealistic suggests that that little long term strategic planning has been undertaken\";s:6:\"higher\";s:138:\"A well-defined achievable exit strategy is indicative of sound management, effective strategic planning and realistic financial projection\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:12:\"None Defined\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:25:\"Unrealistic Exit Strategy\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:19:\"Vague Exit Strategy\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:23:\"Unplanned Exit Strategy\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:26:\"Well Defined Exit Strategy\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}', '2017-09-10 13:07:09', null, 'true', '151', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('264', 'Exit Time Period', 'raw', 'a:5:{s:8:\"question\";s:64:\"Is there an intention of selling the business in the near future\";s:5:\"lower\";s:130:\"No planned exit may infer the venture is only envisaged as a lifestyle business, or a family run business with a longer term view.\";s:6:\"higher\";s:236:\"An early sale in the short term suggests there are interested buyers in the market. This may have been your original intention to recoup your investment and exit the business early as there are other opportunities you now wish to pursue\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:5:\"Never\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:12:\"5 to 6 Years\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:12:\"3 to 5 Years\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:12:\"1 to 3 Years\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:16:\"Less than 1 Year\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '151', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('263', 'Harvestability', 'raw', 'a:5:{s:8:\"question\";s:57:\"How easy do you believe it would be to sell the business?\";s:5:\"lower\";s:142:\"Unless harvest options are built into the business from day one, it will be very difficult to obtain a satisfactory return on your investment \";s:6:\"higher\";s:160:\"Three or more exit options provides the business with a strong negotiable position,  allowing room to manoeuvre, and potentially price negotiation on your terms\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:10:\"Impossible\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:13:\"1 Exit Option\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:14:\"2 Exit Options\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:14:\"3 Exit Options\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:24:\"More than 3 Exit Options\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '151', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('262', 'Cost Structure (ratio of fixed to variable costs)', 'raw', 'a:5:{s:8:\"question\";s:35:\"How flexible is the cost structure?\";s:5:\"lower\";s:172:\"No or minimal flexibility in fixed or variable costs can increase the risk to long term viability by limiting ability of the business to adapt to changing market conditions\";s:6:\"higher\";s:220:\"A business with a flexible cost structure is better positioned to take advantages of market opportunities as they arise, or can make immediate adjustments as an important stream of revenue or profit becomes impaired.\r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:20:\"Extremely Inflexible\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:11:\" Inflexible\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:18:\" Somewhat Flexible\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:8:\"Flexible\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:19:\" Extremely Flexible\";s:5:\"score\";i:5;}}s:6:\"global\";i:1;}', '2017-09-10 13:07:09', null, 'true', '150', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('261', 'Time to Breakeven', 'raw', 'a:5:{s:8:\"question\";s:60:\"How long before the business will be operating at breakeven?\";s:5:\"lower\";s:185:\"To sell less than the breakeven point results in a loss. A longer period to achieve breakeven will defer profitability. Reduction in fixed costs may be able to reduce time to breakeven.\";s:6:\"higher\";s:280:\"Ability to breakeven early frees the business to target smaller, more attractive niches (rather than the broader market) and hence tailor products/services to provide more value to the customer resulting in greater brand equity, and positive effects on price, margin and/or share.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:7:\"5 Years\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"4 Years\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:7:\"3 Years\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:7:\"2 Years\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:17:\"Less than 2 Years\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}', '2017-09-10 13:07:09', null, 'true', '150', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('260', 'Time to Profit (Annual)', 'raw', 'a:5:{s:8:\"question\";s:56:\"How long before the business will show an annual profit?\";s:5:\"lower\";s:193:\"Profit is a measurement of the overall performance of the company and those ventures that take 2 – 3 years to achieve an annual profit will struggle to achieve satisfactory levels of growth. \";s:6:\"higher\";s:143:\"Ventures able to show an annual profit within the first year demonstrate stronger potential for accelerated growth and long term sustainability\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:17:\"More than 3 Years\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:12:\"2 to 3 Years\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:15:\"12 to 24 Months\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:14:\"6 to 12 Months\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:18:\"More than 6 Months\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}', '2017-09-10 13:07:09', null, 'true', '150', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('259', 'Gross Margin', 'raw', 'a:5:{s:8:\"question\";s:46:\"How large is the gross margin of the business?\";s:5:\"lower\";s:209:\"A robust gross margin is a key indicator of overall health of the business. A poor gross margin may leave the business in a vulnerable state to deal with fluctuations in the market or a sustained drop in sales\";s:6:\"higher\";s:237:\"A robust gross margin is a key indicator of the overall health of the business. The gross margin demonstrates that the average mark up on products/services adequately covers direct expenses and has the capacity to generate a profit. \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:13:\"Less than 20%\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:10:\"20% to 35%\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:10:\"35% to 65%\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:10:\"65% to 80%\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:14:\" More than 80%\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}', '2017-09-10 13:07:09', null, 'true', '150', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('258', 'Working Capital', 'raw', 'a:5:{s:8:\"question\";s:57:\"Does the business require high levels of working capital?\";s:5:\"lower\";s:281:\"There is a delicate balance in having just the right amount of working capital on hand. Implications to high levels of working capital include having insufficient funds to purchase revenue generating assets, such as equipment, plant, etc, and providing suboptimal business returns.\";s:6:\"higher\";s:257:\"There is an art to managing the delicate balance in amount of working capital required. A general maxim proposes minimising investment in working capital, but using caution to control this so that credit worthiness is not impaired in the eyes of creditors. \";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:14:\"Extremely High\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:4:\"High\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:8:\"Moderate\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:3:\"Low\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:13:\"Extremely Low\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}', '2017-09-10 13:07:09', null, 'true', '150', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('257', 'Sales Growth', 'raw', 'a:5:{s:8:\"question\";s:58:\"What is the annual sales growth potential of the business?\";s:5:\"lower\";s:309:\"Lower sales growth may result from using own revenue to remain self-sustaining. If the business was to accelerate growth beyond this threshold it would need to seek outside funding. Slow growth rates may also result from a slowing economy or may be synonymous with a mature industry vs cutting edge technology\";s:6:\"higher\";s:388:\"Sales growth of greater than 20 to 30% demonstrates potential for fast growth. Accelerated growth can create difficulties if the business does not control the growth process (ability to keep pace with the expansion, fill orders, hire and train qualified employees, etc). Unanticipated boost in sales can leave growing ventures with a difficulty to obtain cash requirements from operations\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:12:\"Less than 5%\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:13:\"Less than 10%\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:12:\"At least 15%\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\" At least 20%\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:17:\" In excess of 30%\";s:5:\"score\";i:5;}}s:6:\"global\";i:1;}', '2017-09-10 13:07:09', null, 'true', '150', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('256', ' Internal Rate of Return (IRR)', 'raw', 'a:5:{s:8:\"question\";s:27:\" What is the IRR potential?\";s:5:\"lower\";s:193:\"Internal rate of return (IRR) is a capital budgeting metric that measures profitability of investments. A low IRR (lower than the minimum hurdle rate) will signpost poor financial performance. \";s:6:\"higher\";s:275:\"Internal rate of return (IRR) is a capital budgeting metric measuring profitability of investments. Typically the higher the IRR (equal or greater than the hurdle rate) assumes healthier financial performance and a greater ability to make more significant capital gains. \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:13:\"Less than 10%\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:10:\"Around 20%\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:10:\"Around 30%\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:10:\"Around 40%\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:16:\"In Excess of 50%\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}', '2017-09-10 13:07:09', null, 'true', '150', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('254', 'After tax profits', 'raw', 'a:5:{s:8:\"question\";s:62:\"What level of after tax profits are achievable within 5 years?\";s:5:\"lower\";s:204:\"A low percentage of after tax profit on sales may signal to investors or lenders that business profitability is marginal and/or the entrepreneurial team lack effective financial management control systems\";s:6:\"higher\";s:232:\"Higher profit margins, expressed as a percentage of sales, provide investors and lenders with insight into business profitability and illustrate how effectively the entrepreneurial team manage to squeeze money out of total revenue. \";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:21:\"Less than 3% on Sales\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:20:\"At least 5% on Sales\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:22:\"At least 7.5% on Sales\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:21:\"At least 10% on Sales\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:20:\"15% or more on Sales\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}', '2017-09-10 13:07:09', null, 'true', '150', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('255', 'Net Cash Flow', 'raw', 'a:5:{s:8:\"question\";s:58:\"How long does it take to develop a positive net cash flow?\";s:5:\"lower\";s:241:\"Inability to generate an early positive cash flow may have serious implications for long-term success of the business. It is critical to monitor cash flow as it is key in depicting the venture’s financial health to investors and/or lenders\";s:6:\"higher\";s:277:\"Generating an early positive sustainable cash flow is critical for a firm\'s long-term success. Keeping track of cash flow is also important as how cash flow is captured and monitored plays a significant role in depicting the venture’s financial health to potential investors.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:17:\"More than 3 Years\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"3 Years\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:7:\"2 Years\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:9:\"1.5 Years\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:6:\"1 Year\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}', '2017-09-10 13:07:09', null, 'true', '150', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('253', 'Capital Requirements', 'raw', 'a:5:{s:8:\"question\";s:91:\"Are high levels of capital required for the venture relative to the industry that it is in?\";s:5:\"lower\";s:371:\"Capital investment should benefit a company in the long run, but it can have a short-term downside. Intensive, ongoing capital investment reduces interim earnings, can strain liquidity, and potentially dilute earnings/ownership if new equity is used. Plan capital requirements as levels above industry average may adversely impact ongoing success and growth of a business\";s:6:\"higher\";s:484:\"Capital investment should benefit a company in the long run, but it can have a short-term downside. Intensive, ongoing capital investment reduces interim earnings, can strain liquidity, and potentially dilute earnings/ownership if new equity is used. Levels of capital below industry average may provide opportunity for competitive advantage, but if relatively low levels of capital are the industry standard this will create low barriers to entry and a market with strong competition\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:14:\"Extremely High\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:4:\"High\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:6:\"Medium\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:3:\"Low\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:8:\"Very Low\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}', '2017-09-10 13:07:09', null, 'true', '150', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('252', 'Insurance', 'raw', 'a:5:{s:8:\"question\";s:96:\"Does the business operate in a high risk industry for example agriculture, mining, construction?\";s:5:\"lower\";s:102:\"Businesses that operate in a lower risk industry can save significant costs in relation to insurance. \";s:6:\"higher\";s:172:\"If the business operates in a high risk industry that is cyclical, sensitive to environmental issues, etc, suggests that insurance costs may impact heavily on the business.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}', '2017-09-10 13:07:09', null, 'true', '149', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('250', 'Proprietary protection', 'raw', 'a:5:{s:8:\"question\";s:74:\"Does the firm have or can it gain protection of its proprietary knowledge?\";s:5:\"lower\";s:134:\"Little or no intellectual property (IP) leaves you vulnerable to infringement through imitation with no recourse to claim recompense. \";s:6:\"higher\";s:135:\"Strong intellectual property (IP) protection secures your place in the market and can increase the value and sale price of the business\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:7:\"No I.P.\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:15:\"Developing I.P.\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:9:\"Some I.P.\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:15:\"Finalising I.P.\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:23:\"Strong I.P. Protection \";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}', '2017-09-10 13:07:09', null, 'true', '149', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('251', 'Technology Ownership', 'raw', 'a:5:{s:8:\"question\";s:90:\"Does the business own the technology or does it license the technology from another party?\";s:5:\"lower\";s:118:\"Where high licensing fees are paid this could impact on the cash flow, profit margins, and sale price of the business.\";s:6:\"higher\";s:122:\"Owning IP provides added stability to the business and has the potential to open the door to multiple exit strategies.\r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:18:\"Technology is Free\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:28:\"Discussing Licensing Options\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:22:\"Technology is Licensed\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:28:\"Finalising Licensing Options\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:25:\"Technology is Proprietary\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}', '2017-09-10 13:07:09', null, 'true', '149', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('249', 'R&D Dependency', 'raw', 'a:5:{s:8:\"question\";s:39:\"Does this business require ongoing R&D?\";s:5:\"lower\";s:153:\"R&D requires significant ongoing cost to maintain future product pipeline and market opportunities. Profit will be minimized by the quantum of R&D spend.\";s:6:\"higher\";s:142:\"Very low level R&D dependency levels has the ability to increase profit margins and redirect these funds into building the brand and business.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:11:\"significant\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:10:\"continuous\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:6:\"medium\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:3:\"low\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:7:\"minimal\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '148', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('248', 'R&D Funding Sufficiency', 'raw', 'a:5:{s:8:\"question\";s:45:\"Are there sufficient funds committed for R&D?\";s:5:\"lower\";s:167:\"none or insufficient R&D funding committed infers that that the business may be struggling with cash flow or little importance is given to the necessity for innovation\";s:6:\"higher\";s:122:\"sufficient resources committed to R&D suggests the business has a clear innovation agenda aimed at disrupting the market. \";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:4:\"None\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:12:\"Insufficient\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:9:\"Resonable\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:8:\"Adequate\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:10:\"Sufficient\";s:5:\"score\";i:5;}}s:6:\"global\";i:1;}', '2017-09-10 13:07:09', null, 'true', '148', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('247', 'R&D Program', 'raw', 'a:5:{s:8:\"question\";s:48:\"Is there an ongoing R&D Program in the business?\";s:5:\"lower\";s:111:\"No R&D suggests there is a lack of innovation within the business, which allows others to disrupt your position\";s:6:\"higher\";s:131:\"A robust R&D program suggests you are attentive to innovation and realize the importance of this in progressing your business \r\n \r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:4:\"None\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:3:\"Low\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:6:\"Medium\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:13:\"Very Detailed\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '148', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('245', 'Transportation Costs', 'raw', 'a:5:{s:8:\"question\";s:45:\"Do transportation costs provide an advantage?\";s:5:\"lower\";s:94:\"High transportation costs will be a competitive disadvantage as this will reduce profit margin\";s:6:\"higher\";s:122:\"Virtual or minimal transportation costs will prove an advantage over those businesses that require physical transportation\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:4:\"None\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:5:\"Minor\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:4:\"Some\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:4:\"High\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:11:\"Significant\";s:5:\"score\";i:5;}}s:6:\"global\";i:1;}', '2017-09-10 13:07:09', null, 'true', '147', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('246', 'Market Structure ', 'raw', 'a:5:{s:8:\"question\";s:66:\"How difficult is it for potential competitors to enter the market?\";s:5:\"lower\";s:141:\"A low threshold for entry means a high level of competition in that market which will considerably reduce your potential share of that market\";s:6:\"higher\";s:172:\"A high threshold to entry reduces the level of competition within the market which means that you will have the ability to dominate through attaining a greater market share\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:9:\"Very Easy\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:4:\"Easy\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:13:\"Somewhat Easy\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:9:\"Difficult\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:14:\"Very Difficult\";s:5:\"score\";i:5;}}s:6:\"global\";i:1;}', '2017-09-10 13:07:09', null, 'true', '147', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('244', 'Specialist Skills', 'raw', 'a:5:{s:8:\"question\";s:44:\"Does the business require specialist skills?\";s:5:\"lower\";s:124:\"No requirement for specialist skills means that this could be an open and potentially flooded market with strong competition\";s:6:\"higher\";s:146:\"Significant need for specialist skills means your product will be distinctly differentiated and perhaps unique enough to supply a niche market\r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:4:\"None\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:4:\"Some\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:7:\"Average\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:4:\"High\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:11:\"Significant\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}', '2017-09-10 13:07:09', null, 'true', '147', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('243', 'High Capital Costs', 'raw', 'a:5:{s:8:\"question\";s:64:\"Do the costs of installation and operation provide an advantage?\";s:5:\"lower\";s:89:\"Low capital costs indicate low barriers to entry and many competitors entering the market\";s:6:\"higher\";s:164:\"Having access to significant funds for purchase of equipment and production of goods may put you ahead of the competition and potentially accelerate entry to market\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:4:\"None\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:5:\"Minor\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:4:\"Some\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:4:\"High\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:11:\"Significant\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}', '2017-09-10 13:07:09', null, 'true', '147', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('242', 'Lead Time Advantage', 'raw', 'a:5:{s:8:\"question\";s:101:\"How much lead time advantage does the business have before significant competition enters the market?\";s:5:\"lower\";s:137:\"Short lead in time indicates that there is little time for the business to gain stability in the market before competitors begin to enter\";s:6:\"higher\";s:167:\"Considerable lead time means strong barriers to entry which allows the business to establish brand, customer loyalty, and market share Legal/Contractual Advantages\r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:8:\"4 Months\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:13:\"5 to 8 Months\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:14:\"9 to 12 Months\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:15:\"13 to 30 Months\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:19:\"More Than 30 Months\";s:5:\"score\";i:5;}}s:6:\"global\";i:1;}', '2017-09-10 13:07:09', null, 'true', '147', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('241', 'No. of Distribution Channels', 'raw', 'a:5:{s:8:\"question\";s:63:\"How many distribution channels are there for the final product?\";s:5:\"lower\";s:126:\"A single distribution channel leaves the business at risk of not being able to ship product to market and fulfil customer need\";s:6:\"higher\";s:126:\"Several to many distribution channels strengthens the path to market and attains greater product accessibility and thus growth\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:4:\"None\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:1:\"1\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:6:\"2 to 4\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:7:\"4 to 10\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:12:\"More Than 10\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}', '2017-09-10 13:07:09', null, 'true', '146', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('240', 'Established Strategic Alliances', 'raw', 'a:5:{s:8:\"question\";s:51:\"Is there a SCA created through strategic alliances?\";s:5:\"lower\";s:81:\"Absence of strategic alliances diminishes the potential for resourcing and growth\";s:6:\"higher\";s:84:\"Established strategic alliances create an SCA and assist with brand development \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:14:\"Definitely Not\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:5:\"Minor\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:4:\"Some\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:7:\"Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:14:\"Definitely Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '146', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('238', 'Endorsements', 'raw', 'a:5:{s:8:\"question\";s:42:\"Are there any endorsements on the product?\";s:5:\"lower\";s:102:\"No endorsements by third parties leaves the product vulnerable, exposed and few complementary products\";s:6:\"higher\";s:111:\"Significant endorsements create customer value and build brand reputation helping to build market dominance\r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:4:\"None\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:4:\"Some\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:5:\"A Few\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:12:\"Large Number\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:11:\"Significant\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}', '2017-09-10 13:07:09', null, 'true', '146', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('239', 'Number of Supply Channels', 'raw', 'a:5:{s:8:\"question\";s:74:\"How many supply channels are there that allow the access to raw materials?\";s:5:\"lower\";s:123:\"A single supply channel means that you are too reliant on one supplier which exposes your business should the supplier fail\";s:6:\"higher\";s:106:\"Substantial supply channels reduces exposure and risk, plus provides a stronger negotiable supply position\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:6:\"Single\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:2:\">5\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:3:\">10\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:3:\">20\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:4:\"Many\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}', '2017-09-10 13:07:09', null, 'true', '146', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('237', 'Competing Products', 'raw', 'a:5:{s:8:\"question\";s:64:\"Are there similarities and differences with competitor products?\";s:5:\"lower\";s:137:\"Little to no differentiation makes it difficult for customers to have a compelling reason to choose your product over competitor products\";s:6:\"higher\";s:140:\"Highly differentiated products that meet customer needs or solve their problems are more likely to be attract demand over competing products\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:22:\"little Differentiation\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:3:\"low\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:4:\"Some\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:14:\"Above  Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:20:\"High Differentiation\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}', '2017-09-10 13:07:09', null, 'true', '145', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('236', 'No. of Intermediaries', 'raw', 'a:5:{s:8:\"question\";s:64:\"How many parties are between the product and the final consumer?\";s:5:\"lower\";s:143:\"Too many intermediaries between product and customer may make it more difficult to maintain control of relevant components of the sales process\";s:6:\"higher\";s:126:\"The closer you are to the customer the better the distribution control and ability to respond to changing customer needs. \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:4:\"Many\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:1:\"3\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:1:\"2\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:1:\"1\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:6:\"Direct\";s:5:\"score\";i:5;}}s:6:\"global\";i:1;}', '2017-09-10 13:07:09', null, 'true', '145', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('235', 'Satisfied customers', 'raw', 'a:5:{s:8:\"question\";s:67:\"How satisfied are the current customers with the current product/s?\";s:5:\"lower\";s:164:\"Unhappy customers will look for alternate or substitute products in the market. Address reasons for customer dissatisfaction to enable product innovation/adaptation\";s:6:\"higher\";s:108:\"Happy customers enable a firm to build customer loyalty which will result in sales growth and profitability.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:7:\"Unhappy\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:14:\"Somewhat happy\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:5:\"Happy\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:10:\"Very happy\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:15:\"Extremely happy\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}', '2017-09-10 13:07:09', null, 'true', '145', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('234', 'Product Innovation', 'raw', 'a:5:{s:8:\"question\";s:53:\"Is there a SCA created through production innovation?\";s:5:\"lower\";s:124:\"low levels of product innovation indicate there is heavy rivalry in the market leaving little room for competitive advantage\";s:6:\"higher\";s:101:\"Higher levels of product innovation enable a venture to offer a more differentiated or unique product\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:14:\"Definitely Not\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:5:\"Minor\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:4:\"Some\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:7:\"Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:16:\"Definitely Yes\r\n\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '144', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('232', 'Raw material cost', 'raw', 'a:5:{s:8:\"question\";s:67:\"Is there an SCA created through raw material / direct labour costs?\";s:5:\"lower\";s:108:\"Lack of ability to negotiate improved costing for raw direct labour costs provides no competitive advantage \";s:6:\"higher\";s:93:\"Competitive raw material/direct labour costs enable creation of a competitive advantage  \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:14:\"Definitely Not\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:5:\"Minor\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:4:\"Some\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:7:\"Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:14:\"Definitely Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}', '2017-09-10 13:07:09', null, 'true', '144', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('233', 'Technology innovation', 'raw', 'a:5:{s:8:\"question\";s:56:\"Rate the level of the innovation of the product/process?\";s:5:\"lower\";s:128:\"Low levels of technology in the production process infers there are low barriers to entry and competitors could flood the market\";s:6:\"higher\";s:124:\"Higher levels of technology raise the barriers to entry and thus provide time to build market share over the competitors\r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:11:\"Replication\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:10:\"Substitute\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:22:\"Incremental Innovation\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:18:\"Average Innovation\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:6:\"Unique\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '144', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('231', 'Inventory levels', 'raw', 'a:5:{s:8:\"question\";s:62:\"Is there a SCA created through management of inventory levels?\";s:5:\"lower\";s:153:\"Holding too much inventory can cause financial stress for a business as this is the least liquid of current assets and therefore can cause cash shortages\";s:6:\"higher\";s:159:\"Calculating the turnover rate and mix of turnover achieves the fine balance required to maintain an 80/20 rule (80% of sales coming from 20% of inventory) \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:14:\"Definitely Not\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:5:\"Minor\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:4:\"Some\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:7:\"Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:14:\"Definitely Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '144', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('230', 'Scalability', 'raw', 'a:5:{s:8:\"question\";s:75:\"If the production process is scalable, does the scalability provide an SCA?\";s:5:\"lower\";s:55:\"Inability to scale may prove difficult to create an SCA\";s:6:\"higher\";s:133:\"Innovative strategies, that can produce dominant scale in the market, provides a competence to gain an enduring competitive advantage\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:14:\"Definitely Not\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:5:\"Minor\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:4:\"Some\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:7:\"Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:14:\"Definitely Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}', '2017-09-10 13:07:09', null, 'true', '144', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('229', 'Low cost producer', 'raw', 'a:5:{s:8:\"question\";s:74:\"Does the cost advantage provide a Sustainable Competitive Advantage (SCA)?\";s:5:\"lower\";s:104:\"Your competitors are also producing at a low cost and therefore you have a competitive parity and no SCA\";s:6:\"higher\";s:231:\"Producing your product/service at a low cost provides an edge over your competitors. To turn this competitive advantage into a SCA you must continue to implement value-creating strategies that cannot be imitated by your competitors\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:15:\"Definitely Not \";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:5:\"Minor\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:4:\"Some\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:7:\"Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:10:\"Definitely\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '144', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('228', 'Opportunity/resource relationship', 'raw', 'a:5:{s:8:\"question\";s:83:\"Is there a strong relationship between the opportunity and the resources available?\";s:5:\"lower\";s:177:\"A flimsy relationship may indicate bundled resources required for production are heterogeneous across the industry and will not be sufficient to create a sustainable advantage. \";s:6:\"higher\";s:197:\"A strong opportunity/resource relationship indicates you have deep insight into the value of resources required for production and can use the knowledge to uncover other un-exploited opportunities.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:7:\"Average\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:11:\"Exceptional\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}', '2017-09-10 13:07:09', null, 'true', '142', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('227', 'Resource appropriateness', 'raw', 'a:5:{s:8:\"question\";s:59:\"Are the resources identified appropriate for the venture?\r\n\";s:5:\"lower\";s:88:\"Reassessing your resource requirements may offer the venture a better chance of success.\";s:6:\"higher\";s:118:\"Appropriate resources suggest that product production is simplified and entry to market obtainable and/or fast-tracked\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:9:\"Selective\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:8:\"Detailed\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}', '2017-09-10 13:07:09', null, 'true', '142', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('226', 'Resources availability', 'raw', 'a:5:{s:8:\"question\";s:52:\"Is the team able to identify all resources required?\";s:5:\"lower\";s:148:\"If you cannot identify all resources required, go back to the drawing board to seek alternative options or path to market will be slow and difficult\";s:6:\"higher\";s:132:\"Availability of resources appears to be well considered, identifiable and/or detailed suggesting path to market will be unobstructed\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:9:\"Selective\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:8:\"Detailed\";s:5:\"score\";i:5;}}s:6:\"global\";i:1;}', '2017-09-10 13:07:09', null, 'true', '142', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('225', 'Upside/downside issues', 'raw', 'a:5:{s:8:\"question\";s:76:\"Are the upside rewards exceptional relative to the downside possibilities?\r\n\";s:5:\"lower\";s:117:\"downside potential appears to eclipse probable rewards. Reassess as opportunity does not seem viable in current frame\";s:6:\"higher\";s:119:\"Indication is that this could be an exceptional opportunity. Clarify that opportunity potential has viability perceived\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:7:\"Average\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '142', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('224', 'Goal and Fit', 'raw', 'a:5:{s:8:\"question\";s:72:\"Is there a good fit between the business opportunity and the founders?\r\n\";s:5:\"lower\";s:208:\"Poor Founder Market-Fit demonstrates lack of synergy between market opportunity and founder capabilities and experience.  Reassess and pull together additional resources/team members to produce a better fit. \";s:6:\"higher\";s:127:\"Great fit between the opportunity and founders indicates founder fully understands market space and opportunity to be exploited\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:7:\"Average\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:15:\"Clearly Evident\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}', '2017-09-10 13:07:09', null, 'true', '142', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('223', 'Service or product business', 'raw', 'a:5:{s:8:\"question\";s:55:\"What are the storage requirements of the raw materials?\";s:5:\"lower\";s:114:\"Complicated storage requirements can create process inefficiencies and could increase cost of production/operation\";s:6:\"higher\";s:149:\"Simple, little or no storage requirements allow for cost reductions, greater agility in production processes, and potential increase in profit margin\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:20:\"Special Requirements\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:13:\"Needs Shelter\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:18:\"Stored in the Open\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:20:\"Minimal Requirements\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:4:\"None\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}', '2017-09-10 13:07:09', null, 'true', '141', '1', null, '10030', '1006');
