INSERT INTO `ninety_question` VALUES ('219', 'Novelty', 'raw', 'a:5:{s:8:\"question\";s:32:\"Rate the novelty of this product\";s:5:\"lower\";s:218:\"Your product is not unique. Too many competitors with similar products shrinks your potential market. To create a more unique product, review and add innovative and differentiated value within your product development.\";s:6:\"higher\";s:178:\"Uniqueness of a product helps create a sustainable competitive advantage and opens up potential for intellectual property protection and thus increase the value of your business.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:8:\"Generic \";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:4:\"Some\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:7:\"Average\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:6:\"Unique\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}', '2017-09-10 13:07:09', null, 'true', '140', '1', null, '10030', '1006');
INSERT INTO `ninety_question` VALUES ('216', 'Substitute Products', 'raw', 'a:5:{s:8:\"question\";s:52:\"Are there substitutes for the product in the market \";s:5:\"lower\";s:152:\"Intense competitor rivalry within a market widens choice for customers to look at competitors’ products that may be cheaper, equal or superior quality\";s:6:\"higher\";s:96:\"Where few substitutes exist this reduces the risk of customers switching to substitute products \";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:18:\"Significant Number\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:14:\"Large Number\r\n\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:14:\"Average Number\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:12:\"Small Number\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:4:\"None\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}', '2017-09-10 13:07:09', null, 'true', '140', '1', null, '10030', '1006');
