INSERT INTO `ninety_question` VALUES ('196', 'Window of Opportunity', 'raw', 'a:5:{s:8:\"question\";s:18:\"Is there a window?\";s:5:\"lower\";s:200:\"If the window is closing, act quickly to exploit the current window of opportunity remaining, but look at innovating elements of the product/service to identify potential new opportunities or markets.\";s:6:\"higher\";s:112:\"Where the window is opening this indicates a growing market, less rivalry, and possibly lower barriers to entry.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:4:\"Low \";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:10:\"Low/Medium\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:6:\"Medium\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:11:\"Medium/High\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:4:\"High\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '135', '1', null, '10030', '1006');
