INSERT INTO `ninety_question` VALUES ('193', 'International Market Share Attainable', 'raw', 'a:5:{s:8:\"question\";s:105:\"Ultimately, how much of the international market will the business/product occupy? (Over a 5 year period)\";s:5:\"lower\";s:191:\"International market share is low. Analyse reasons for this as there may be hurdles that need to be overcome which may otherwise inhibit ability to increase current international market share\";s:6:\"higher\";s:238:\"An early strong market share can mean first-movers are well into proving longer-term viability. Some industry sectors are ripe for new entrants, leaving potential to saturate the market if such an untapped market niche can be identified. \";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:8:\"Under 1%\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:8:\"2% to 5%\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:9:\"6% to 20%\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:10:\"21% to 50%\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:8:\"Over 50%\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}', '2017-09-10 13:07:09', null, 'true', '134', '1', null, '10030', '1006');
