INSERT INTO `ninety_question_copy` VALUES ('187', 'Market Size Potential', 'raw', 'a:4:{s:8:\"question\";s:88:\"How attractive is the potential size of the market in monetary terms? (Million is sales)\";s:5:\"lower\";s:128:\"Venture could potentially be vulnerable if market size is too small. Reinvestigate market potential to improve current position.\";s:6:\"higher\";s:160:\"Current market size is adequate allowing potential for domestic and international growth, but additional market research could produce greater growth potential.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:12:\"< 20 million\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:16:\"20 to 50 million\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:17:\"50 to 100 million\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:18:\"100 to 500 million\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:13:\"> 500 million\";s:5:\"score\";i:5;}}}', '2017-09-10 13:07:09', null, 'true', '134', '1', null, '10030', '1006');
INSERT INTO `ninety_question_copy` VALUES ('307', 'Economic Conditions', 'raw', 'a:4:{s:8:\"question\";s:62:\"Does the economic conditions support this investment strategy?\";s:5:\"lower\";s:162:\"Disruptive innovations can be difficult to bring to market where there is a lack of infrastructure and the economic conditions do not provide the support required\";s:6:\"higher\";s:111:\"A well-considered and robust business strategy will be reactive and adaptable to changes in economic conditions\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}}', '2017-09-10 13:07:09', null, 'true', '165', '1', null, '10030', '1006');
INSERT INTO `ninety_question_copy` VALUES ('308', 'Social Environment', 'raw', 'a:4:{s:8:\"question\";s:61:\"Does the social environment support this investment strategy?\";s:5:\"lower\";s:166:\"It is important to undertake sufficient research into the external environment as those who fail to react to dramatic social changes risk becoming business casualties\";s:6:\"higher\";s:196:\"Researching the social environment provides viable opportunities for innovation and business development to generate product/service solutions that will give your business a competitive edge. \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}}', '2017-09-10 13:07:09', null, 'true', '166', '1', null, '10030', '1006');
INSERT INTO `ninety_question_copy` VALUES ('309', 'Social Trends', 'raw', 'a:4:{s:8:\"question\";s:83:\"Is the business aligned with developed social trends, ie environmental, ageing etc?\";s:5:\"lower\";s:119:\"No alignment with social trends reflects a disconnect with the customer and environment in which the business operates.\";s:6:\"higher\";s:175:\"Alignment with these social trends suggests well-managed connectivity, strong engagement with the customer segments, as well as the environment in which the business operates.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:8:\"Possibly\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:11:\"Potentially\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}}', '2017-09-10 13:07:09', null, 'true', '166', '1', null, '10030', '1006');
INSERT INTO `ninety_question_copy` VALUES ('310', 'Revolutionary Social Innovations', 'raw', 'a:4:{s:8:\"question\";s:87:\"Is this opportunity in an industry that is considered a cutting edge industry prospect?\";s:5:\"lower\";s:132:\"Failing to look ahead and identify future potential major global societal change may render a business obsolete over the longer term\";s:6:\"higher\";s:221:\"Attention given to revolutionary changes equate to exceptional entrepreneurial opportunities. Prosperity lies with the entrepreneurs/businesses that are first to spot, adapt and exploit these major global societal forces.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}}', '2017-09-10 13:07:09', null, 'true', '166', '1', null, '10030', '1006');
