INSERT INTO `ninety_question_copy` VALUES ('312', 'Infrastructure', 'raw', 'a:4:{s:8:\"question\";s:54:\"Is there a strong technology infrastructure available?\";s:5:\"lower\";s:151:\"A lack of technology infrastructure required infers the venture will need significant funding to invest heavily to develop the infrastructure required.\";s:6:\"higher\";s:173:\"A strong existing technology infrastructure allows the business to exploit new opportunities within a supported framework without having to outsource required technologies. \";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}}', '2017-09-10 13:07:09', null, 'true', '167', '1', null, '10030', '1006');
